import ourClient from "./views/agent/Home/ourClient/ourClient";
import ourClientAdd from "./views/agent/Home/ourClient/ourClientAdd";
import ourPrice from "./views/agent/Home/ourPrice/ourPrice";
import ourPriceAdd from "./views/agent/Home/ourPrice/ourPriceAdd";
import Abouts from "./views/agent/Abouts/Abouts";
import Contact from "./views/agent/Contact/Contact";
import DigitalCertificate from "./views/agent/DigitalCertificate/DigitalCertificate";
